import React from "react";
import classes from './NavBar.module.css';


const NavBar = (props) => {

    return(
        <header className={classes.header}>
            <h1>
            {props.title}
            </h1>
             <div>
                <a href="/auth" className={classes.anchor}>{props.authenticate}</a>
                <a href="/auth" className={classes.anchor}>{props.events}</a>
                <a href="/auth" className={classes.anchor}>{props.bookings}</a>
             </div>
        </header>
    )
};

export default NavBar;
